import React, { Component } from "react";
import NowPlaying from "./components/MovieLists/NowPlaying";
import TopRated from "./components/MovieLists/TopRated";
import Upcoming from "./components/MovieLists/Upcoming";
import StudioGhibli from "./components/MovieLists/StudioGhibli";
import ComedyDramaTV from "./components/MovieLists/ComedyDramaTV";
import PopularTV from "./components/MovieLists/PopularTV";
import Discover from "./components/Discover";
export class Home extends Component {
  render() {
    return (
      <div>
        <Discover />
        <NowPlaying />
        <TopRated />
        <Upcoming />
        <StudioGhibli />
        <PopularTV />
        <ComedyDramaTV />
      </div>
    );
  }
}

export default Home;
